  private ScriptBindings() {}

  public static void applyCoreBindings(
    ScriptRuntime runtime,
    HytaleJS plugin,
    ScriptCommandRegistry commandRegistry,
    ScriptEventRegistry eventRegistry,
    ScriptScheduler scheduler
  ) {
    runtime.eval("globalThis.__commandCallbacks__ = {};" +
      "globalThis.__eventCallbacks__ = {};" +
      "globalThis.__schedulerCallbacks__ = {};");
    runtime.setGlobal("plugin", plugin);
    runtime.setGlobal("logger", new ScriptLogger(plugin.getLogger()));
    runtime.setGlobal("commands", commandRegistry);
    runtime.setGlobal("events", eventRegistry);
    runtime.setGlobal("scheduler", scheduler);
    runtime.setGlobal("metrics", new JavetCallMetrics());
    applyJavaTypeBindings(runtime);
  }

  public static void applyJavaTypeBindings(ScriptRuntime runtime) {
    ClassLoader classLoader = Thread.currentThread().getContextClassLoader();
    for (JavaTypeBinding binding : JAVA_TYPE_BINDINGS) {
      try {
        Class<?> clazz = Class.forName(binding.className(), true, classLoader);
        runtime.setGlobal(binding.name(), clazz);
      } catch (ClassNotFoundException ignored) {
      }
    }
    
    runtime.setGlobal("ScriptCustomUIPage", ScriptCustomUIPage.class);
    runtime.setGlobal("ScriptCustomUIHud", ScriptCustomUIHud.class);
    runtime.setGlobal("ByteArrayCommonAsset", ByteArrayCommonAsset.class);
    runtime.setGlobal("CommonAssetModule", com.hypixel.hytale.server.core.asset.common.CommonAssetModule.class);
  }
